INSERT INTO `products` VALUES (1,'Canon EOS M50 Mirrorless Vlogging Camera Kit with EF-M 15-45mm lens, Black','canon-eos-m50','<div><div>Dual Pixel CMOS AF for fast, accurate autofocus that helps you get the photo you want right as the moment happens</div><div>241 Megapixel APS C CMOS sensor and the DIGIC 8 Image Processor delivers incredible color, clear details, and stunning range</div><div>Variangle Touchscreen LCD has a flexible tilt range ideal for high angle and low angle shooting, and reviewing your photos</div><div>Built in high resolution electronic viewfinder features approximately 2,360,000 dots to see high amounts of detail when capturing</div><div>Use the EOS Utility Webcam Beta Software (Mac and Windows) to turn your compatible Canon camera into a high-quality webcam</div></div>','<div><div><b>The EOS M50 is a compact interchangeable lens camera for aspiring photographers looking for an easy way to boost the quality of their photos and videos. With clear, high-resolution 4K UHD 24p video, you can capture the incredible details and cinematic moments of your life at home or wherever your adventures take you.</b></div><div><br></div><div>Snap vibrant, eye-catching photos with a <b>24.1 Megapixel (APS-C)</b> CMOS Sensor using the built-in Electronic Viewfinder or Vari-angle Touchscreen LCD. Thanks to the fast and improved Dual Pixel CMOS Autofocus system, you can quickly lock focus on your subject to make sure you don\'t miss the action. See how the EOS M50 can easily deliver the high-quality photos and videos you\'ve always imagined.</div></div>','canon eos m50.png',NULL,'2022-08-30 11:10:40.611000',_binary '',_binary '',0.01,0.01,12,5,5,3,2,1,10),(2,'Sony ZV-1 Camera for Content Creators, vlogging and YouTube with flip screen and microphone','sony-zv-1','<ul><li><span style=\"font-size: 1rem;\">20.1MP stacked back illuminated 1\" Exmor RS CMOS sensor w/ DRAM, Large aperture 24-70mm1 F1.8-2.8 ZEISS Vario-Sonnar T lens</span></li><li><span style=\"font-size: 1rem;\">Fast Hybrid AF, Real Time Eye-AF3 and Real-time AF tracking</span></li><li><span style=\"font-size: 1rem;\">Quickly switch between two modes of defocused background bokeh</span></li><li><span style=\"font-size: 1rem;\">Product Showcase Setting transitions focus from face to object</span></li><li><span style=\"font-size: 1rem;\">Face priority AE keeps faces bright in backlit or dim condition</span></li><li><span style=\"font-size: 1rem;\">What\'s In The Box: Rechargeable Battery Pack (NP-BX1), Micro USB Cable, Wind Screen, Wind Screen Adaptor, Strap</span></li></ul>','<div><div>Sony ZV-1 Camera for Content Creators and Vloggers, packed with advanced imaging technology and easy-to-use functionality.</div><div>The ZV-1 is designed to bring together simplicity and power, opening up creative opportunities as wide as your imagination.</div><div>The ZV-1 design makes creating outstanding selfie and vlog content easy. Right down to the last detail, the ZV-1 is all about empowering you to make inspirational content.</div></div>','Sony ZV-1 main.png','2022-08-05 11:27:15.000000','2022-08-05 15:45:17.000000',_binary '',_binary '',711,789,0,4.3,2.5,2,0.9,3,10),(3,'Panasonic Lumix FZ80 4K Digital Camera','panasonic-lumix-fz80','<div><ul><li>18.1 Megapixel Video Camera</li><li>60X Zoom DC VARIO 20-1200mm Lens</li><li>F2.8-5.9 Aperture</li><li>Power O.I.S. Stabilization</li><li>Touch Enabled 3-Inch LCD</li><li>Wi-Fi, DC-FZ80K (Black)</li></ul></div>','<div>Perfect for travelers, the Panasonic Lumix Digital Camera DC FZ80K brings the legendary optical performance of a super long 60X (20 1200mm) DC Vario lens with amazingly stable O.I.S. (Optical Image Stabilizer) to a highly portable point and shoot travel camera. With a powerful 18.1 megapixel MOS sensor, the Lumix DC VARIO camera lens features a super bright F2.8 5.9 aperture range that is optically stabilized with Panasonic’s Power O.I.S. technology to add striking depth of field dimension to your photographs even in low light conditions. The high resolution power of 4K video technology captures up to 4X the resolution (3840 x 2160) of standard Full HD, enabling you to create printable photos with 4K photo\'s blistering 30 frames per second burst feature. Post Focus and Focus Stacking provide for additional creative freedom by allowing you to change depth of field or focus points after you take the picture. The Lumix FZ80 perfectly fits in your hand with an ergonomic grip while its rear touch enabled 3 inch LCD display and high resolution 1,170K dot viewfinder remain clear even in bright sunlight. Convenient travel ready technologies like USB charging and Wi Fi connectivity to your mobile device make the Lumix DC FZ80K a digital camera that everyone can enjoy.<br></div>','Lumix FZ80 main.png',NULL,'2022-08-25 17:27:28.559000',_binary '',_binary '',235,298,24.99,5.3,5,4,1.75,7,10),(4,'Pelican 1200 Case With Foam (Black)','pelican-1200-case','<div><ul><li>Completely Watertight</li><li>Indestructible</li><li>Customized Fit</li><li>Trusted by Professionals</li></ul></div>','<div><div>Pelican Protector Cases are made with Copolymer Polypropylene, using an open cell core and solid wall construction, which is stronger and lighter that the completion. You can tell its a Pelican case by the distinctive \"twin-ribbed\" top surface. Stainless steel pins are used for hinges and handles. The new Double-Throw latches are much easier to open.Pelican cases are kept watertight through the use of a tongue and groove fit and a polymer o-ring.</div><div>Pelican cases come standard with an Automatic Pressure Equalization Valve which releases built up air pressure while keeping water out.</div><div>Pelican\'s Pick N\'Pluck foam lets you customize the interior. Stainless steel hardware</div><div>Interior Dimensions (inches): 9.25 x 7.12 x 4.12</div><div>LID DEPTH- 1.18Inches (3 cm). BOTTOM DEPTH- 2.93 Inches (7.4 cm). TOTAL DEPTH- 4.11Inches(10.4 cm). TOTAL DEPTH- 4.11 Inches (10.4 cm). INT VOLUME- 0.16 ft³ (0.005 m³) Weight With Foam 2.87 lbs (1.3 kg) Weight Empty 2.65 lbs (1.2 kg) Buoyancy 12.02 lbs (5.5 kg)</div><div>Pelican cases are kept watertight through the use of a tongue and groove fit and a polymer o-ring.</div><div>Pelican cases come standard with an Automatic Pressure Equalization Valve which releases built up air pressure while keeping water out.</div><div>Pelican\'s Pick N\'Pluck foam lets you customize the interior.</div><div>Single folding front handle</div></div>','Pelican 1200 Case main.png','2022-08-05 12:08:13.000000','2022-08-25 12:11:50.000000',_binary '',_binary '',0,54.95,0,0,0,0,0,8,9),(5,'Pelican 1040 Micro Case (Black/Clear)','pelican-1040-micro-case','<div><ul><li>Water resistant, crushproof and dustproof</li><li>Rubber liner for extra protection, doubles as o-ring seal</li><li>Stainless steel hardware</li><li>Clear polycarbonate lid to easily identify items in the box</li><li>Interior Dimensions (inches): 6. 50 x 3. 87 x 1. 75</li><li>Great for rugged sports - not for swimming or submerging</li><li>Water-resistant, crush-proof and dust-proof</li></ul></div>','<div><div>This water-resistant, crushproof case is ideal for <font color=\"#ff0000\">rugged activities</font>. It will keep your expensive GPS, cell phones and other electronics and documents safe and secure. For over 30 years Pelican has built a reputation for manufacturing the toughest cases in the world. As a matter of fact, we invented the category. Over these years we\'ve seen our cases used for some fairly crazy activities...and important ones too.</div><div><b><br></b></div><div><b>Pelican Micro Cases</b> are created for your smaller items. Micro Cases look and function in the same way as the larger Pelican Cases, but are designed to protect your cell phone, iPod, camera, and other small items. Many of the cases are water resistant and crushproof, or impact resistant to provide maximum protection for your valuables. These cases will get your gear from point A to point B in the condition it\'s meant to be in: intact and functional.</div></div>','Pelican 1040 Micro Case 1.png','2022-08-05 12:13:33.000000','2022-08-25 12:15:23.000000',_binary '',_binary '\0',0,14.95,0,0,0,0,0,8,9),(6,'Verizon Prepaid - Apple iPhone 6S (32GB) - Space Gray','verizon-apple-iphone-6s','<div>Carrier - This Device is locked to the Verizon prepaid network.<br></div>','<div><ul><li>Plans - Choose from four different plans, including unlimited data. Hurry to tale Advantage of the current double data limited time offer.</li><li>ACTIVATION - Activate your plan at Vzw. com/prepaid and access the My Verizon app after activation to easily manage your account.</li><li>4. 7-Inch Retina HD display</li><li>12MP camera and 4K video</li><li>5MP FaceTime HD camera with Retina Flash</li><li>Touch ID for secure authentication and Apple Pay</li><li><span style=\"font-size: 1rem;\">A9 chip</span></li><li>Ios 12 with Group FaceTime, screen Time, and even faster performance</li></ul></div>','Verizon Apple iPhone 6S main.png','2022-08-05 12:26:27.000000','2022-08-21 17:13:50.000000',_binary '',_binary '',201,249.99,0,5.8,3,0.7,0.5,9,14),(7,'Samsung Galaxy Note II, White 16GB (AT&T)','Samsung-Galaxy-Note-II,-White-16GB-(AT&T)','<div><ul><li>Display: 5.5-inches</li><li>Camera: 8-MP</li><li>Processor Speed: 1.6 GHz</li><li>OS: Android 4.1 (Jelly Bean)</li></ul></div>','<div>Samsung Galaxy Note II brings a whole new category of smartphones to AT&amp;T. This high-performance device boasts many rich features and is indispensable when it comes to entertainment and productivity thanks to an enhanced S Pen hover experience, intuitive software, and elegant hardware features. Touch, hover, scribble, and speak—the Note II offers multiple tactile ways to interact. Capture and create with the innovative S Pen and preloaded apps like S Memo and S Note. Enjoy multitasking, intuitive interactions, customizable home screens, and more on the latest Google OS Android 4.1, Jelly Bean and the Samsung TouchWiz platform. With the latest HD Super AMOLED Plus technology powering the Note II’s 5.5-inch 720P display, images are bigger, clearer, and brighter than ever allowing you to view color-rich movies, photos, presentations, and gaming. With Note II performance and power are automatic, thanks to Samsung’s Exynos 1.6 Ghz quad-core processor, a long-lasting battery, and blazing fast 4G LTE network speeds.<br></div>','Samsung Galaxy Note 2 main.png','2022-08-05 13:34:36.000000','2022-08-12 16:47:09.000000',_binary '',_binary '',513,599.99,0,4,1.5,6.2,0.6,10,14),(8,'Samsung 860 EVO 500GB 2.5 Inch SATA III Internal SSD (MZ-76E500B/AM)','Samsung-860-EVO-500GB-2.5-Inch-SATA-III-Internal-SSD','<div><ul><li>Brand: Samsung Electronics</li><li>Digital Storage Capacity: 500 GB</li><li>Hardware Interface: SATA 6.0 Gb/s</li><li>Type of product: 2.5 inches</li><li>Write Speed: 520 megabits_per_second</li></ul></div>','<div><div>Innovative V-Nand Technology: Powered by Samsung V-NAND Technology, the 860 EVO SSD offers optimized performance for everyday computing as well as rendering large-sized 4K videos and 3D data used by the latest applications</div><div>Enhanced read write speeds: Sequential read and write performance levels of up to 550MB/s and 520MB/s, respectively</div><div>Secure encryption: Protect data by selecting security options, including AES 256-bit hardware-based encryption compliant with TCG Opal and IEEE 1670</div><div>Warranty and compatibility: 5-year limited warranty; Windows 8/Windows 7/Windows Server 2003 (32 bit and 64 bit), Vista (SP1 and above), XP (SP2 and above), MAC OSX and Linux</div><div>Included contents: 2.5 inches (7 millimeter) SATA 3 (6 Gb/s) SSD &amp; user manual (All other cables, screws, brackets not included); Reliability (MTBF): 1.5 Million Hours Reliability (MTBF)</div></div>','Samsung 500GB SSD main 2.png','2022-08-05 14:00:57.000000','2022-08-12 11:38:09.000000',_binary '',_binary '',49,109.99,37,4.5,3.5,0.5,0.6,10,27),(9,'Canon PowerShot ELPH 180 Digital Camera','Canon-PowerShot-ELPH-180-Digital-Camera','<div>Canon PowerShot ELPH 180 Digital Camera w/ Image Stabilization and Smart AUTO Mode (Silver), 0.90in. x 3.70in. x 2.10in. - 1093C001<br></div>','<div><div>8x Optical Zoom with Optical Image Stabilizer helps you capture images with flexibility and ease</div><div>20.0 Megapixel CCD sensor combines with the DIGIC 4+ Image Processor to help deliver stunning image quality</div><div>720p HD video capabilities.Focusing Range:Normal: 2.0 in. - infinity (W), 4.3 ft. (1.3m) - infinity (T)</div><div>Smart AUTO intelligently selects the proper settings based on predefined shooting situations</div><div>Digital IS helps reduce the effect of camera shake and subject movement.Operating Temperature:32-104°F / 0-40°C.Compatible with Android devices version 4.0 or later</div><div>Scene Modes such as Fisheye Effect, Toy Camera Effect and Monochrome provide creative freedom to capture your photos</div></div>','Powershot ELPH 180 main.png',NULL,'2022-08-25 17:27:02.629000',_binary '',_binary '',82,100,50,4.3,1.3,2.5,0.5,1,10),(10,'Olympus Tough TG-6 Waterproof Camera, Red','Olympus-Tough-TG-6-Waterproof-Camera,-Red','<div><ul><li>Waterproof (50 feet /15 meter), dust proof, shockproof (7 feet / 2.1 meter), crush proof (100kgf), freeze proof (14 degree Fahrenheit / -10 degree Celsius ), anti fog</li><li>High resolution F2.0 lens, maximum 8x zoom, true pic VIII, back illuminated CMOS image sensor</li><li>Variable macro system comprised of 4 macro shooting modes, magnified shooting up to 1 centimeter from the end of the lens</li><li>5 underwater shooting modes including underwater microscope, 3 underwater white balance modes</li><li>4K movie and full HD 120 fps high speed movies can be recorded. Battery life - Approx. 340 Images (using Toshiba SDHC UHS-I Card Exceria with IS ON, based on CIPA test standards). Approx. 50 minutes (under standard JEITA testing). Approx. 110 minutes (when zoom and other operational functions are not used). When repeatedly recording at the maximum time of 29 minutes</li></ul></div>','<div>You live for the outdoors. Hiking steep mountain trails. Backpacking through a desert Canyon. Skiing in the wilderness. The tough tg-6 is ready for adventure. It’s built to endure all the extreme environments you love exploring. You can drop it. Step on it. Go deep underwater or out into a freezing blizzard. It just keeps on shooting awesome stills and video. Packed with pro features, you’ll nail difficult shots — even in low light. Shoot intricately detailed macro photos and unique shots underwater with vivid color. The lightweight, compact tough tg-6. Engineered to survive the world’s toughest places.<br></div>','Olympus Tough main.png',NULL,'2022-08-25 17:27:15.579000',_binary '',_binary '',289,349,30,5,3,2,1.5,11,10);
